import React from 'react';
import Bar from './components/Bar';
import Heading from './components/Heading';
import "./oferta.css";
  
const Oferta = () => {
  return (
    <div>
        <Bar title={"Oferta"} />
      <div className='oferta1'>
      <Heading title={"Zajęcia dzieci"} />
      <div className='oferta1-text'>Poprzez profesjonalnie dopracowany program zajęć w przedszkolu gwarantujemy wszystkim dzieciom
wyjątkowy zakres doświadczeń. Uczęszczając na zajęcia w przedszkolu dzieci rozwijają się w odpowiednim dla
siebie tempie, a także mają możliwość odkrycia nowych pasji. Oferujemy szereg ćwiczeń gimnastycznych,
angażujące gry zespołowe oraz rozwijanie indywidualnych umiejętności.</div>

<div className='oferta1-container'>
<div className='oferta1-item'>
  <div className='item-content'>
    <div className='icon'>
      <img src='./icon6.png' alt='icon'></img>
    </div>
    <div className='text'>
      <h2>Gimnastyka z fizjoterapeutą</h2>
    </div>
  </div>
</div>

</div>
    </div>
      </div>
    
  );
};
  
export default Oferta;
